import React, { Component } from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
const routes = [
  {
    path: "/",
    exact: true,
    sidebar: () => <div>home</div>,
    main: () => <h2>HOME</h2>
  },
  {
    path: "/b",
    sidebar: () => <div>bome</div>,
    main: () => <h2>BOME</h2>
  },
  {
    path: "/c",
    sidebar: () => <div>come</div>,
    main: () => <h2>COME</h2>
  }
];
export default class Test extends Component {
  render() {
    return <div></div>;
  }
}
